INSERT INTO `question` VALUES (20220329, '选择', '过期的化妆品是什么垃圾?', '可回收垃圾；厨余垃圾；有害垃圾；其他垃圾', 'C', '过期化妆品里有对人体和自然环境有危害的物质。');
INSERT INTO `question` VALUES (20220330, '选择', '杀虫剂的容器属于哪一类垃圾？', '可回收垃圾；厨余垃圾；有害垃圾；其他垃圾', 'C', '杀虫剂容器多为塑料或金属材质，但由于杀虫剂中含有有害成分，对人体健康有一定危害，因此杀虫剂容器属于有害垃圾。');
INSERT INTO `question` VALUES (20220331, '选择', '撕掉了的旧照片，应该丢到哪个垃圾桶内？', '可回收垃圾；厨余垃圾；有害垃圾；其他垃圾', 'C', '照片在洗印过程中，会使用含毒的化学制剂，如氰化物、重金属等，对人体健康或自然环境有潜在危害。属于有害垃圾。');
INSERT INTO `question` VALUES (20220401, '选择', '“排行榜”中“行”读？', 'xíng；héng；háng；钝角', 'A', 'Happy April Fool\'s Day');
INSERT INTO `question` VALUES (20220402, '选择', '废电池乱丢对人体可能造成____?', '镉中毒；氰中毒；碳中毒；氟中毒', 'A', '废旧电池主要有毒物质:铅,汞,镉。世界卫生组织国际癌症研究机构公布的致癌物清单初步整理参考,铅在2B类致癌物清单中。汞常温下即可蒸发,汞蒸气和汞的化合物多有剧毒(慢性)。镉会对呼吸道产生刺激,长期暴露会造成嗅觉丧失症、牙龈黄斑或渐成黄圈,镉化合物不易被肠道吸收,但可经呼吸被体内吸收,积存于肝或肾脏造成危害,尤以对肾脏损害最为明显。还可导致骨质疏松和软化。');
INSERT INTO `question` VALUES (20220403, '选择', '包了口香糖的纸巾属于哪一类垃圾?', '可回收垃圾；厨余垃圾；有害垃圾；其他垃圾', 'D', '包了口香糖、擦了鼻涕的纸巾都是其他垃圾。');
INSERT INTO `question` VALUES (20220404, '选择', '保鲜膜属于哪类垃圾?', '可回收垃圾；厨余垃圾；有害垃圾；其他垃圾', 'D', '除了可回收垃圾、有害垃圾、厨余垃圾以外的垃圾都属于其他垃圾,包括餐盒、餐巾纸、湿纸巾、塑料袋、食品包装袋等。');
INSERT INTO `question` VALUES (20220405, '选择', '变质的香肠属于哪一类垃圾?', '可回收垃圾；厨余垃圾；有害垃圾；其他垃圾', 'B', '香肠是易腐烂的生物质废弃物,因此属于厨余垃圾。');
INSERT INTO `question` VALUES (20220406, '选择', '槟榔渣属于哪类垃圾?', '可回收垃圾；厨余垃圾；有害垃圾；其他垃圾', 'B', '槟榔渣属于厨余垃圾,像茶包、茶叶渣还有冲泡饮料粉末等都属于此类。');
INSERT INTO `question` VALUES (20220407, '选择', '剥掉的蛋壳属于哪一类垃圾？', '可回收垃圾；厨余垃圾；有害垃圾；其他垃圾', 'B', '蛋壳是易腐烂的生物质废弃物,应该投入厨余垃圾桶。');
INSERT INTO `question` VALUES (20220408, '选择', '菜刀属于哪类垃圾?', '可回收垃圾；厨余垃圾；有害垃圾；其他垃圾', 'A', '可回收物分为纸类、塑料橡胶类、玻璃类、金属类等,食品罐盒、剪刀、金属办公用品、刀片等都属于金属类,因此属于可回收垃圾。');
INSERT INTO `question` VALUES (20220409, '选择', '茶叶渣应扔进哪个垃圾桶?', '可回收垃圾；厨余垃圾；有害垃圾；其他垃圾', 'B', '茶叶渣因其易腐性属于厨余垃圾。');
INSERT INTO `question` VALUES (20220410, '选择', '吃剩的饼干渣是什么垃圾?', '可回收垃圾；厨余垃圾；有害垃圾；其他垃圾', 'B', '饼干渣是容易腐烂的生物质废弃物,属于厨余垃圾。');
INSERT INTO `question` VALUES (20220411, '选择', '抽完烟的烟蒂是什么垃圾?', '可回收垃圾；厨余垃圾；有害垃圾；其他垃圾', 'D', '烟蒂这样既没有回收利用价值、也不容易腐烂的垃圾,应该投放到其他垃圾桶中。');
INSERT INTO `question` VALUES (20220412, '选择', '刀片属于哪类垃圾?', '可回收垃圾；厨余垃圾；有害垃圾；其他垃圾', 'A', '可回收物分为纸类、塑料橡胶类、玻璃类、金属类等,食品罐盒、剪刀、金属办公用品、刀片等都属于金属类,因此属于可回收物。');
INSERT INTO `question` VALUES (20220413, '选择', '掉在地上的树叶是什么垃圾?', '可回收垃圾；厨余垃圾；有害垃圾；其他垃圾', 'B', '树叶是容易腐烂的生物质废弃物,属于厨余垃圾。');
INSERT INTO `question` VALUES (20220414, '选择', '废旧的鼠标应扔进哪个垃圾桶?', '可回收垃圾；厨余垃圾；有害垃圾；其他垃圾', 'A', '鼠标是由塑料、金属制成,属于可回收物。');
INSERT INTO `question` VALUES (20220415, '选择', '废旧的荧光灯管应扔进哪个垃圾桶?', '可回收垃圾；厨余垃圾；有害垃圾；其他垃圾', 'C', '荧光灯管里有对人体和自然环境有危害的物质,属于有害垃圾。');
INSERT INTO `question` VALUES (20220416, '选择', '废弃的食用油属于?', '可回收垃圾；厨余垃圾；有害垃圾；其他垃圾', 'B', '食用油属于厨余垃圾,需要注意的是:这样流质的厨余垃圾应直接倒入下水口,而不是投放到厨余垃圾桶中。');
INSERT INTO `question` VALUES (20220417, '选择', '废弃的钥匙属于哪类垃圾?', '可回收垃圾；厨余垃圾；有害垃圾；其他垃圾', 'A', '钥匙是由合金制成,属于可回收物。');
INSERT INTO `question` VALUES (20220418, '选择', '刚吃完的外卖你会怎么丢掉?', '残余食物扔去厨余垃圾；外卖盒子扔去其他垃圾；分别处理A和B；一起扔掉', 'C', '有包装的厨余垃圾应去除包装后再将它投递进厨余垃圾桶,包装物投递到相应的可回收物或其他垃圾桶。');
